import Mongoose from "mongoose";

const Schema = Mongoose.Schema;

// Create Schema
const UserSchema = new Schema({
  first_name: {
    type: String
  },
  last_name: {
    type: String
  },
  email: {
    type: String,
    required: true
  },
  password: {
    type: String,
    required: true
  },
  date: {
    type: Date,
    default: Date.now
  }
});

var User = Mongoose.model("user-info", UserSchema);

export default User;
